import React from 'react'
import "./Login.css"

 function Login() {
    return (
        <div className='login'>

            <div className="login__container">
                <img
                    src="https://www.freepnglogos.com/uploads/email-logo-png-22.png"
                    alt=""
                />
                <Button variant="contained" color="primary" onClick={signIn}>Login</Button>
            </div>
        </div>
    );
}
export default Login;
